import React, { useState } from "react";
import axios from "axios";
import ImageCard from "./ImageCard";

const SearchResult = ({query}) => {
  const API_KEY = "26Cjl48gOvMj2jQKAAbJCRckpcH2IPlR9edG21W_hRM";
  const [data, setData] = useState([]);

  const searchImage = async (e) => {
    e.preventDefault();
    const getSearchImages = await axios.get(
      `https://api.unsplash.com/search/photos?query=${query}?per_page=30`,
      {
        headers: {
          Authorization: `Client-ID ${API_KEY}`,
        },
      }
    );
    console.log(getSearchImages.data.results);
    setData(getSearchImages.data.results);
  };

  return <div>SearchResult</div>;
};

export default SearchResult;
